            TIP_VOICE_CONVERSATIONS_BODY: "여기에서 **음성 설정**을 변경할 수 있습니다.\n\n마이크와 소리를 켜고 끄거나 설정을 변경할 수 있습니다.\n녹음 방식을 **음성 감지에서 누르며 말하기(PTT)**로 변경하려면 톱니바퀴 모양을 눌러보세요.",
