            TIP_WHOS_ONLINE_BODY: "현재 보고 있는 채널에 누가 있는지는 여기에서 확인할 수 있습니다.\n\n데스크톱 버전을 사용하는 사람은 자신이 하고 있는 게임의 이름도 표시되며, 원하는 사람을 선택해 개별적으로 음량을 조정하거나 관리할 수 있는 **설정 창**을 열어볼 수 있습니다.",
